import {GET_PROFILE,PROFILE_ERROR} from"../actions/types"
const initialState = {
    profile:{},
    errors:{},
};
export default function(state = initialState,action){
    const {type,payload} =action
    switch(type){
        case GET_PROFILE:
                return{
                    ...state,
                    profile:payload,
                };
                
    }
}
